import React from 'react'

const Vhe = (props) => {
    return (
        <>
            <div className='vhe_DIV'>
                <div>{props.vhe.vheId}</div>
                <div>{props.vhe.vheName}</div>
            </div>
        </>
    )
}

export default Vhe
